            array('id' => '3940', 'folio' => 'A03289', 'isbn' => '84-200-0945-8', 'title' => 'TECNOLOGÍA DE PRODUCTOS AVÍCOLAS', 'autor' => 'MOUNTNEY, GEORGE J.', 'description' => 'La industria avicola - Identificacion de la calidad - Mantenimiento de la calidad - Caracteristicas quimicas y nutritivas -Caracteristicas y medidas del rendimiento - Microbiologia de la carne de ave - Suministro de agua, distribucion en planta e higienizacion - Procesado de aves frescas - Envasado - Almacenamiento refrigerado - Productos a base de ave enlatada y procesado de sopas - Deshidratacion - Curado y ahumado - Conservacion por irradiacion - Otros productos procesados - Aves para cocinar en guisos y barbacoas - Subproductos no comestibles - Identificacion de la calidad de los huevos - Medida de la calidad de los huevos - Mantenimiento de la calidad del huevo - Huevos: caracteristicas fisicas, quimicas, nutritivas y funcionales - Microbiologia de los huevos - Procesado de huevos - Metodos de analisis de huevos y productos derivados.', 'editorial' => 'ACRIBIA', 'area' => 'Procesos Bioalimentarios', 'quantity' => '1', 'edition' => 'TERCERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2001-01-04', 'pages' => '448', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '67', 'date_of_acq' => '2023-01-04', 'created_at' => '2023-01-05 00:01:23', 'updated_at' => '2023-01-04 17:16:44', 'deleted_at' => NULL, 'donated' => '0'),
            array('id' => '3941', 'folio' => 'A03288', 'isbn' => '84-7978-727-9', 'title' => 'TOXICOLAGÍA ALIMENTARIA', 'autor' => 'CAMEÁN, ANA M.', 'description' => 'La toxicología alimentaria es una disciplina que reclama, cada vez más, la atención de investigadores y autoridades académicas, legislativas y gubernativas. El hombre ha debido aprender por experiencia propia, a veces dolorosa, a distinguir entre alimentos saludables y nocivos y, a lo largo de los siglos, a producir, conservar y preparar sus alimentos de la forma más beneficiosa. Pero el crecimiento de la población, la industrialización, la comercialización a gran escala, el mercantilismo, la no observancia de las legislaciones, etc., ha permitido la aparición de brotes e incluso de epidemias tóxicas de origen alimentario con cientos y hasta miles de intoxicados agudos, además de los incontables de carácter crónico, que son los que los alimentos pueden producir en mayor cantidad y de forma más solapada. INDICE: Introducción y conceptos. Principales mecanismos de absorción de tóxicos presentes en los alimentos. Importancia de la microbiótica del tracto gastrointestinal en toxicología. Biodisponibilidad de sustancias tóxicas en los alimentos. Evolución de la toxicidad de aditivos y contaminantes presentes en alimentos. La aplicación de procedimientos in vitro en la evaluación toxicológica. Evaluación de riesgos. Biotoxinas marinas. Toxinas de cianofíceas. Alimentos con sustancias tóxicas de orinen natural: plantas superiores. Intoxicaciones por plantas medicinales. Intoxicaciones por setas. Contaminantes biológicos. La calidad como prevención de las intoxicaciones alimentarias. Micotoxinas. Riesgo tóxico por metales presentes en alimentos. Residuos de plaguicidas en alimentos. Residuos de medicamentos de uso veterinario. Riesgos tóxicos por consumo de animales de caza. Residuos de componentes de plástico en los alimentos. Toxicología de los aditivos alimentarios. Grasas y aceites alimentarios. Las vitaminas. Evaluación de los nuevos alimentos. Alergia alimentaria. Dieta y Cáncer. Riesgo tóxico por radionúclidos. Irradiación de alimentos. Las fuentes de información en toxicología alimentaria: bases de datos accesibles en Internet. Manejo clínico de las intoxicaciones alimentarias.', 'editorial' => 'DÍAZ DE SANTOS', 'area' => 'Procesos Bioalimentarios', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2006-01-04', 'pages' => '690', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '67', 'date_of_acq' => '2023-01-04', 'created_at' => '2023-01-05 00:06:38', 'updated_at' => '2023-01-04 17:15:59', 'deleted_at' => NULL, 'donated' => '0'),
