            array('id' => '3944', 'folio' => 'A03292', 'isbn' => '84-200-0831-1', 'title' => 'FRUTAS Y HORTALIZAS MÍNIMAMENTE PROCESADAS Y REFRIGERADAS', 'autor' => 'WILEY, ROBERT C.', 'description' => NULL, 'editorial' => 'ACRIBIA', 'area' => 'Procesos Bioalimentarios', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '1997-01-04', 'pages' => '364', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => NULL, 'classification_id' => '1', 'date_of_acq' => '2022-10-27', 'created_at' => '2023-01-05 00:28:51', 'updated_at' => NULL, 'deleted_at' => NULL, 'donated' => '0'),
            array('id' => '3945', 'folio' => 'A03293', 'isbn' => '978-84-200-0986-5', 'title' => 'HIGIENE DE LOS ALIMENTOS, MICROBIOLOGÍA Y HACCP', 'autor' => 'FORSYTHE, S.J.', 'description' => 'La microbiologia de los alimentos es una ciencia fascinante y retadora. Es tambien muy exigente ya que se mueve en un mar, constantemente cambiante, de normas, reglamentos y maquinaria. La preocupacion de la poblacion por la seguridad alimentaria la lleva a valorar excesivamente ciertos riesgos al mismo tiempo que se despreocupa de las practicas higienicas normales de los fabricantes de alimentos. Esta tercera edicion pretende poner al dia a quienes les preocupa la produccion higienica de los alimentos en aspectos clave del HACCP, de la higiene alimentaria y de la metodologia analitica de deteccion de microorganismos.Hemos incluido tambien algunas novedades como la nueva variante de la CJD (relacionada con las "vacas locas" que padecen BSE), que en el momento de escribir este libro ha producido la muerte de 20 personas pero que debido a lo incierto de su fase de incubacion podria ser un problema mucho mas serio.En el Reino Unido los medios de comunicacion han prestado tanta atencion al brote provocado por "Escherichia coli 001157: H7" que el gobierno ha iniciado una investigacion a gran escala y ha recomendado que se le aplique el HACCP.por esto lo incluimos en esta edicion.Se habla mucho de la aplicacion del HACCP para producir alimentos higienicamente pero su implementacion, sobre todo en pequenas empresas, es dificil. Este libro no pretende ensenar como hacer el HACCP ya que lo hacen muchos de los otros libros que se encuentran a la venta. Sin embargo, intenta proporcionar a este fin un fondo de conocimientos mas completo teniendo en cuenta una perspectiva mundial.El nuevo titulo del libro refleja su mayor enfasis en el tratamiento de alguna de sus materias', 'editorial' => 'ACRIBIA', 'area' => 'Procesos Bioalimentarios', 'quantity' => '1', 'edition' => '2a EDICIÓN', 'cou