            array('id' => '3973', 'folio' => 'A03321', 'isbn' => '978-1-119-39621-5', 'title' => 'HACKEAR AL HACKER APRENDE DE LOS EXPERTOS QUE DERROTAN A LOS HACKERS', 'autor' => 'GRIMES, ROGER A.', 'description' => NULL, 'editorial' => 'MARCOMBO', 'area' => 'Tecnologías', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'MÉXICO', 'date_of_pub' => '2017-01-04', 'pages' => '308', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '63', 'date_of_acq' => '2022-11-14', 'created_at' => '2023-01-05 05:26:21', 'updated_at' => '2023-01-04 22:39:32', 'deleted_at' => NULL, 'donated' => '0'),
            array('id' => '3974', 'folio' => 'A03322', 'isbn' => '978-1-119-39621-5', 'title' => 'HACKEAR AL HACKER APRENDE DE LOS EXPERTOS QUE DERROTAN A LOS HACKERS', 'autor' => 'GRIMES, ROGER A.', 'description' => 'Meet the world\'s top ethical hackers and explore the tools of the trade Hacking the Hacker takes you inside the world of cybersecurity to show you what goes on behind the scenes, and introduces you to the men and women on the front lines of this technological arms race. Twenty-six of the world\'s top white hat hackers, security researchers, writers, and leaders, describe what they do and why, with each profile preceded by a no-experience-necessary explanation of the relevant technology. Dorothy Denning discusses advanced persistent threats, Martin Hellman describes how he helped invent public key encryption, Bill Cheswick talks about firewalls, Dr. Charlie Miller talks about hacking cars, and other cybersecurity experts from around the world detail the threats, their defenses, and the tools and techniques they use to thwart the most advanced criminals history has ever seen. Light on jargon and heavy on intrigue, this book is designed to be an introduction to the field; final chapters include a guide for parents of young hackers, as well as the Code of Ethical Hacking to help you start your own journey to the top. Cybersecurity is becoming increasingly critical at all levels, from retail businesses all the way up to national security. This book drives to the heart of the field, introducing the people and practices that help keep our world secure. Go deep into the world of white hat hacking to grasp just how critical cybersecurity is Read the stories of some of the world\'s most renowned computer security experts Learn how hackers do what they do—no technical expertise necessary Delve into social engineering, cryptography, penetration testing, network attacks, and more As a field, cybersecurity is large and multi-faceted—yet not historically diverse. Wi