            array('id' => '4002', 'folio' => 'A03350', 'isbn' => '978-84-277-2351-1', 'title' => 'MODELOS DIDÁCTICOS PARA SITUACIONES Y CONTEXTOS DE APRENDIZAJE', 'autor' => 'HERNÁNDEZ, CRUZ A.', 'description' => 'Un libro teórico-práctico, fruto de la amplia experiencia de los autores, que tiene como propósito, de manera sencilla pero rigurosa, facilitar, mediar y ayudar al docente, en la aplicación de las mejores y más eficaces estrategias de enseñanza-aprendizaje, a través de diversos modelos didácticos, con el fin de que los aprendices aprovechen al máximo sus capacidades y logren un mayor rendimiento, con un esfuerzo razonable. En los más de 30 modelos didácticos que ofrece el libro, se desarrollan todos los aspectos necesarios para su comprensión e implementación: definición y objetivos, es decir, lo que se pretende lograr con la aplicación del modelo; desarrollo de la estrategia didáctica, el procedimiento o protocolo que tanto el docente como el aprendiz han de seguir en el acto didáctico; los aprendizajes esperados cuando se aplica cada modelo; los medios y recursos didácticos para desarrollar cada modelo; y la evaluación de la estrategia. Un texto imprescindible para todos los docentes que forman a los futuros profesores y para los educadores de cualquier nivel: desde preescolar a primaria, secundaria, superior y postgrado.', 'editorial' => 'NARCEA', 'area' => 'Enfermería', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2017-01-09', 'pages' => '192', 'shelf' => '300', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '31', 'date_of_acq' => '2022-11-30', 'created_at' => '2023-01-10 03:19:35', 'updated_at' => '2023-01-09 20:24:25', 'deleted_at' => NULL, 'donated' => '0'),
