            array('id' => '4019', 'folio' => 'A03367', 'isbn' => '978-84-8476-667-4', 'title' => 'USUARIO PROFESIONAL DE PRODUCTOS FITOSANITARIOS. APLICADOR DE PLAGUICIDAS', 'autor' => 'MORENO VEGA, ALBERTO', 'description' => NULL, 'editorial' => 'MUNDI-PRENSA', 'area' => 'Agricultura', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2017-01-16', 'pages' => '356', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => NULL, 'classification_id' => '64', 'date_of_acq' => '2022-12-12', 'created_at' => '2023-01-17 04:06:21', 'updated_at' => NULL, 'deleted_at' => NULL, 'donated' => '0'),
            array('id' => '4020', 'folio' => 'A03368', 'isbn' => '978-84-8476-667-4', 'title' => 'USUARIO PROFESIONAL DE PRODUCTOS FITOSANITARIOS. APLICADOR DE PLAGUICIDAS', 'autor' => 'MORENO VEGA, ALBERTO', 'description' => 'A partir del 26 de noviembre de 2015, los usuarios profesionales y vendedores de productos fitosanitarios en España deberán poseer un carné que acredite los conocimientos apropiados para ejercer su actividad, según los niveles de capacitación establecidos en el artículo 18 y las materias especificadas para cada nivel en el Real Decreto 1311/2012, de 14 de septiembre, Anexo IV, por el que se fija el marco de actuación para conseguir un uso sostenible de los productos fitosanitarios. La Editorial Mundi-Prensa ha desarrollado este libro dedicado a los usuarios y aplicadores profesionales de productos fitosanitarios (plaguicidas), con el objetivo de responder a la demanda de formación exigida por la normativa vigente que regula el Carné de Manipulador de Productos Fitosanitarios para el Nivel Cualificado. Este carné va dirigido a los usuarios y aplicadores profesionales responsables de los tratamientos terrestres, incluidos los no agrícolas, a los agricultores que realizan tratamientos empleando personal auxiliar y el personal que, directamente, intervenga en la venta de productos fitosanitarios de uso profesional, capacitando para proporcionar la información adecuada sobre su manejo, sus riesgos para la salud humana y el medio ambiente y las instrucciones para mitigar dichos riesgos. Con tal fin se ha desarrollado en este libro el temario especificado por el mencionado RD 1311/2012 para el nivel cualificado de usuarios y aplicadores profesionales de productos fitosanitarios (plaguicidas). Todos los contenidos han sido explicados con la extensión que le corresponde a cada epígrafe y planteados de un modo práctico, incluyendo abundantes fotografías, ejercicios y preguntas tipo test, cuya intención principal es que la presente obra resulte de un alto valor didáctico para quienes desean examinarse por el órgano competente de su Comunidad Autónoma.', 'editorial' => 'MUNDI-PRENSA', 'area' => 'Agricultura', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2017-01-16', 'pages' => '356', 'shelf' => '600', 'status' => '1', 'created_by' => '3', 'updated_by' => NULL, 'classification_id' => '64', 'date_of_acq' => '2022-12-12', 'created_at' => '2023-01-17 04:14:10', 'updated_at' => NULL, 'deleted_at' => NULL, 'donated' => '0'),
