            array('id' => '4056', 'folio' => 'A03406', 'isbn' => '978-84-233-3967-9', 'title' => 'LA MUERTE LENTA DE LUCIANA B.', 'autor' => 'MARTÍNEZ, GUILLERMO', 'description' => 'Diez años después, nada queda en Luciana de la muchacha alegre y seductora a la que el famoso escritor Kloster dictaba sus novelas. Tras las trágicas muertes primero de su novio y después, uno a uno, de sus seres más queridos, Luciana vive aterrorizada, vigilando cada sombra, cada persona que se cruza a su lado, con la sospecha de que esas muertes no pueden ser casuales, sino parte de una venganza metódica urdida contra ella, un círculo a su alrededor que sólo se cerrará con el número siete. En la desesperación más absoluta, recurre a la única persona capaz de adentrarse en el siniestro universo de Kloster. Los cuadernos de notas de Henry James y una Biblia de Scofield serán claves ambiguas en un pasaje sin retorno a la región más primitiva del mal. Tras el impresionante éxito internacional de Los crímenes de Oxford, cuya adaptación cinematográfica se estrenará próximamente, Guillermo Martínez ha escrito una obra de una intensidad extraordinaria que lo confirma como un autor de referencia de la literatura contemporánea. Una novela deslumbrante que cautiva con una escritura limpia y precisa, y mantiene al lector en vilo hasta la última página.', 'editorial' => 'DESTINO', 'area' => 'Otros', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'ESPAÑA', 'date_of_pub' => '2007-02-02', 'pages' => '232', 'shelf' => '800', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '81', 'date_of_acq' => '2022-11-12', 'created_at' => '2023-01-25 05:19:18', 'updated_at' => '2023-02-02 18:13:29', 'deleted_at' => NULL, 'donated' => '0'),
