            array('id' => '4058', 'folio' => 'A03405', 'isbn' => '968-7711-07-8', 'title' => 'LA LIBERTAD NUNCA SE OLVIDA MEMORIA DEL 68', 'autor' => 'GUEVARA NIEBLA, GILBERTO', 'description' => '"Descripción minuciosa del ambiente y los hechos que integran lo que se conoce como el "Movimiento del 68", La libertad nunca se olvida recupera con rigor y precisión documental la información de primera mano, las voces de los líderes, los militantes y los adversarios del movimiento, hasta lograr un saldo objetivo y subjetivo del año en que México estuvo a las puertas de esta realidad, la de la democracia actual, obligada a esperar casi cuarenta años. Gilberto Guevara Niebla reconstruye cronológicamente y revisa críticamente los hechos y su experiencia personal. Su Memoria del 68 es una lectura política y un testimonio que sin hacer a un lado la emotividad, el descubrimiento y la excitación colectiva de la movilización estudiantil, un verdadero homenaje a la vida en la intensa celebración de la fiesta cívica, muestra también el alto precio del sectarismo y el voluntarismo radical en un ambiente de ceguera ideológica. Este libro de Gilberto Guevara Niebla es el más importante aporte al estudio del México de 68."--Back cover.', 'editorial' => 'EDICIONES CAL Y ARENA', 'area' => 'Otros', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'MÉXICO', 'date_of_pub' => '2004-02-02', 'pages' => '336', 'shelf' => '800', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '81', 'date_of_acq' => '2022-11-12', 'created_at' => '2023-01-25 05:24:26', 'updated_at' => '2023-02-02 18:12:46', 'deleted_at' => NULL, 'donated' => '0'),
