            array('id' => '4064', 'folio' => 'A03415', 'isbn' => '978-970-780-905-5', 'title' => 'SALIDA DE EMERGENCIA', 'autor' => 'MEJÍA MADRID, FABRIZIO', 'description' => 'A group of thirty chronicles that Fabrizio Meja Madrid spun along thirteen years while strolling up and down the national territory, from the forest to the desert, from the mountains to the highlands, to end, like so many other Mexicans every year, crossing the northern frontier. New drugs, saints with beatified roosters, murderers of one night and of one life, communards with "machetes" and teachers surrounding the foreigner murdered in Oaxaca, a town of kidnappers and three missing towns, the television that presents circus phenomena, the fantasies of the national porn, the corpses of too many women in the desert and the escape of two undocumented immigrants towards the promissory North. Emergency Exit: our last decade together, from south to north, told with journalistic accuracy and narrative agility; swallowed in occasions by tragedy, most of the time consumed by absurdity. Welcome. Is this (or was) Mexico? Una treintena de crnicas que Fabrizio Meja Madrid hil a lo largo de trece aos mientras se paseaba a lo largo y ancho del territorio nacional, desde la selva hasta el desierto, desde la montaa hasta el altiplano, para terminar, como tantos otros mexicanos cada ao, cruzando la frontera norte. Nuevas drogas, santos con gallos beatificados, asesinos de una noche y de una vida, comuneros con machetes y maestros que rodean al gringo asesinado en Oaxaca, un pueblo de secuestradores y tres pueblos desaparecidos, la televisin que presenta fenmenos de circo, las fantasas del porno nacional, los cadveres de demasiadas mujeres en el desierto y la fuga de dos indocumentados hacia el norte promisorio. Salida de emergencia: nuestra ltima dcada juntos, de sur a norte, contada con precisin periodstica y agilidad narrativa; tragada en ocasiones por la tragedia, las ms de las veces consumida por el absurdo. Bienvenidos. Esto es Mxico (o esto fue Mxico?).', 'editorial' => 'RAMDOM HOUSE MONDADORI', 'area' => 'Otros', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'MÉXICO', 'date_of_pub' => '2007-02-02', 'pages' => '296', 'shelf' => '800', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '81', 'date_of_acq' => '2022-11-12', 'created_at' => '2023-01-26 01:38:42', 'updated_at' => '2023-02-02 18:24:16', 'deleted_at' => NULL, 'donated' => '0'),
