            array('id' => '4104', 'folio' => 'A03452', 'isbn' => '978-0-8027-7918-2', 'title' => 'THE DEAD WITNESS', 'autor' => 'SIMS, MICHAEL', 'description' => 'Gathering the finest adventures among private and police detectives from the nineteenth and early twentieth centuries-including a wide range of overlooked gems-Michael Sims showcases the writers who ever since have inspired the field of detective fiction. From luminaries Mark Twain, Charles Dickens, Bret Harte, Wilkie Collins, and Arthur Conan Doyle to the forgotten author who helped inspire Edgar Allan Poe\'s "The Murders in the Rue Morgue" to a surprising range of talented female authors and detectives, The Dead Witness offers mystery surprises from every direction. The 1866 title story, by Australian writer Mary Fortune, is the first known detective story by a woman, a suspenseful clue-strewn manhunt in the Outback. Pioneer writers Anna Katharine Green and C. L. Pirkis take you from high society New York to bustling London, introducing colorful detectives such as Violet Strange and Loveday Brooke. In another forgotten classic, November Joe, the Canadian half-Native backwoods detective who stars in Hesketh Prichard\'s "The Crime at Big Tree Portage," demonstrates that Sherlockian attention to detail works as well in the woods as in the city. Holmes himself is here, too, of course-not in another reprint of an already well-known story, but in the first two chapters of A Study in Scarlet, the first Holmes case, in which the great man meets and dazzles Watson. Introduced by Michael Sims\'s insightful overview of detective fiction, The Dead Witness unfolds the irresistible antecedents of what would mature into the most popular genre of the twentieth century.', 'editorial' => 'WALKER & COMPANY', 'area' => 'Otros', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'U.S.A.', 'date_of_pub' => '2012-01-31', 'pages' => '576', 'shelf' => '800', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '82', 'date_of_acq' => '2022-11-12', 'created_at' => '2023-01-31 05:41:17', 'updated_at' => '2023-01-31 22:34:42', 'deleted_at' => NULL, 'donated' => '0'),
            array('id' => '4105', 'folio' => 'A03453', 'isbn' => '978-0-307-74299-5', 'title' => 'THE SNOWMAN', 'autor' => 'NESBO, JO', 'description' => 'INTERNATIONAL BESTSELLER • Inspector Harry Hole tracks a Norwegian serial killer in this “fiendishly complex and terrifically entertaining” (The New York Times Book Review) installment of the New York Times bestselling series. "Maddeningly addictive.” —Vanity Fair One night, after the first snowfall of the year, a boy named Jonas wakes up and discovers that his mother has disappeared. Only one trace of her remains: a pink scarf, his Christmas gift to her, now worn by the snowman that inexplicably appeared in their yard earlier that day. Inspector Harry Hole suspects a link between the missing woman and a suspicious letter he’s received. The case deepens when a pattern emerges: over the past decade, eleven women have vanished—all on the day of the first snow. But this is a killer who makes his own rules ... and he’ll break his pattern just to keep the game interesting, as he draws Harry ever closer into his twisted web. With brilliantly realized characters and hair-raising suspense, international bestselling author Jo Nesbø presents his most chilling case yet—one that will test Harry Hole to the very limits of his sanity.', 'editorial' => 'VINTAGE CRIME', 'area' => 'Otros', 'quantity' => '1', 'edition' => 'PRIMERA EDICIÓN', 'country' => 'U.S.A.', 'date_of_pub' => '2012-01-31', 'pages' => '502', 'shelf' => '800', 'status' => '1', 'created_by' => '3', 'updated_by' => '3', 'classification_id' => '82', 'date_of_acq' => '2022-11-12', 'created_at' => '2023-01-31 05:44:18', 'updated_at' => '2023-01-31 22:35:26', 'deleted_at' => NULL, 'donated' => '0'),
